DESCRIPTION:
Nesutinku su jūsų atsakymu <a href="https://tvarkaumiesta.lt/problem/168275:" target="_blank">https://tvarkaumiesta.lt/problem/168275:</a>

&#34;informuojame, kad poreikio papildomos infrastruktūros įrengimui nurodytoje Konstitucijos prospekto atkarpoje nematome (pėstieji linkę eiti esamu šaligatviu toliau nuo gatvės).&#34;

Ten ne šaligatvis, o PARKINGAS. Pėstieji turi eiti parkingu. Nesaugu - susidūrimu su mašina pavojus. Problema neišspręsta.

ANSWER:
 Vilniaus miesto savivaldybės administracija gavo Jūsų 2020 m. gruodžio 10 d. skundą (Savivaldybėje registruota 2020 m. gruodžio 10 d., reg. Nr. E50-65526/20(3.2.9E-UK9) dėl tabako dūmų, kurie patenka į Jūsų butą pro buto, esančio Tyzenhauzų g. 7-83, Vilniuje vonios, tualeto patalpas.
Lietuvos Respublikos tabako, tabako gaminių ir su jais susijusių gaminių kontrolės įstatymo (toliau – Įstatymas) 19 straipsnyje nustatyta, kad Lietuvos Respublikoje rūkyti (vartoti tabako gaminius) draudžiama: 
1) visose švietimo, socialinių paslaugų įstaigose, kuriose teikiamos socialinės priežiūros ir (ar) socialinės globos paslaugos vaikams, sveikatos priežiūros įstaigose ir šių įstaigų teritorijose;
2) darbo vietose, esančiose uždarose patalpose. Įmonėse, įstaigose ir organizacijose gali būti įrengtos specialios patalpos (vietos), kuriose leidžiama rūkyti. Rūkymo patalpų (vietų) įrengimo ir eksploatavimo reikalavimus nustato Lietuvos Respublikos Vyriausybė ar jos įgaliota institucija;
3) bendrose gyvenamosiose, kitose bendro naudojimo patalpose, kuriose nerūkantieji gali būti priversti kvėpuoti tabako dūmais užterštu oru;
4) visų rūšių viešajame transporte, išskyrus tolimojo susisiekimo traukinius, kuriuose turi būti numatyti atskiri vagonai nerūkantiesiems ir rūkantiesiems, taip pat orlaivius, kuriuose numatytos atskiros vietos nerūkantiesiems ir rūkantiesiems;
5) restoranuose, kavinėse, baruose, kitose viešojo maitinimo įstaigose, klubuose, diskotekose, interneto kavinėse (interneto klubuose ir pan.), lošimo namuose (kazino), automatų ar bingo salonuose, kitose laisvalaikio praleidimo įstaigose, patalpose, kuriose vyksta sporto varžybos ar kiti renginiai, ir kitose žmonėms aptarnauti skirtose patalpose, išskyrus specialiai įrengtus cigarų ir (ar) pypkių klubus. Cigarų ir (ar) pypkių klubų įrengimo tvarką nustato Lietuvos Respublikos Vyriausybė ar jos įgaliota institucija;
6) transporto priemonių salonuose, jeigu juose yra asmenų iki 18 metų ir (ar) nėščių moterų.
Galiojantys Lietuvos Respublikos įstatymai nenumato draudimo rūkyti bute ar buto vonioje, tualete, todėl nėra teisinio pagrindo reikalauti, kad Jūsų kaimynai nerūkytų savo bute.
Lietuvos Respublikos Seimas 2020 m. spalio 1 d. priėmė Lietuvos Respublikos tabako, tabako gaminių ir su jais susijusių gaminių kontrolės įstatymo Nr. I-II43 19 straipsnio pakeitimo projektą Nr. XIII-3320, kuriame numatyta, kad nuo 2021 m. sausio 1 d. bus draudžiama rūkyti daugiabučių namų balkonuose, terasose, lodžijose, nuosavybės teise priklausančiuose atskiriems savininkams, kai bent vienas namo gyventojas prieštarauja rūkymui.
Atsižvelgdami į tai, kad tabako dūmų problema Jums yra aktuali, 2020 m. gruodžio 11 d. raštu Nr. A51-157495/20(3.3.2.26-ADV) kreipėmės į buto Tyzenhauzų g. 7-83 gyventoją, prašydami gerbti Jūsų teisę į tabako dūmais neužterštą orą ir rūkyti vietoje, iš kurios tabako dūmai nesklistų į Jūsų butą.
Jei situacija nepagėrės, po 2021 m. sausio 1 d. turėsite teisę kreiptis į Savivaldybės administraciją su prieštaravimu dėl rūkymo namo Tyzenhauzų g. 7 balkonuose. Savivaldybės administracija, atsižvelgdama į Jūsų prieštaravimą uždraus rūkyti namo Tyzenhauzų g. 7 balkonuose, o policijos ir (ar) Savivaldybės administracijos Viešosios tvarkos skyriaus pareigūnams nustačius rūkymo faktą, kaltiems asmenims galės būti taikoma administracinė atsakomybė.
Pažeidimų nustatymas ir kaltininkų patraukimas administracinėn atsakomybėn labai priklauso nuo operatyvaus pranešimo apie daromą teisės pažeidimą. Jei ateityje pastebėsite galimus pažeidimus, apie tai nedelsiant praneškite policijai telefonu 112 arba Savivaldybės administracijos Viešosios tvarkos skyriui telefonu 219 7948 ar elektroniniu paštu <a href="mailto:viesoji.tvarka@vilnius.lt,">viesoji.tvarka@vilnius.lt,</a> kad Savivaldybės administracijos Viešosios tvarkos skyriaus pareigūnai, atvykę pagal pranešimą, turėtų galimybę tinkamai surinkti įrodymus apie pažeidimą, nustatyti pažeidimą padariusius asmenis ir patraukti juos atsakomybėn. Atkreipiame Jūsų dėmesį į tai, kad viešosios tvarkos ir visuomenės saugumo užtikrinimas yra pagrindiniai policijos uždaviniai, todėl nenutrūkstamas policijos darbas organizuojamas visą parą, o Savivaldybė tik dalyvauja, bendradarbiauja užtikrindama viešąją tvarką, todėl neturi galimybės nuolat ir nedelsdama reaguoti į asmenų pranešimus apie galbūt padarytus teisės pažeidimus. Savivaldybės administracijos Viešosios tvarkos skyriaus pareigūnai dirba pirmadieniais–ketvirtadieniais nuo 6 iki 23 val., penktadieniais nuo 6 iki 24 val., šeštadieniais nuo 0 iki 2 val. ir nuo 8 iki 24 val., sekmadieniais nuo 0 iki 2 val. ir nuo 8 iki 22 val.
